This Quarterly Report on Form 10-Q may contain statistics and other data that, in some cases, have been obtained or compiled from information made available by mortgage loan servicers and other third-party service providers.
Factors Affecting our Operating Results Our net interest income includes income from our securities portfolio, including the amortization of purchase premiums and accretion of purchase discounts. Net interest income, as well as our servicing income, net of servicing costs, will fluctuate primarily as a result of changes in market interest rates, our financing costs and prepayment speeds on our assets. Interest rates, financing costs and prepayment rates vary according to the type of investment, conditions in the financial markets, competition and other factors, none of which can be predicted with any certainty.
